import React, { Component } from "react";
import WelcomeImg from "./images/welcome.png";
import "./Card.css";

class Card extends Component {
  render() {
      console.log(this.props);
    return <div className='Card' key={this.props.name}>
        <a href=''>
            <div className="card-category hvr-grow hvr-sweep-to-bottom" style={{backgroundImage: this.props.img }}>
                <p>
                    {this.props.desc}
                </p>
            </div>
        </a>
    </div>;
  }
}
export default Card;
